import React from "react";

interface Props {
  formType: "signup" | "login";
}

const AuthForm: React.FC<Props> = ({ formType }) => {
  if (formType === "signup") {
    return <div>Signup</div>;
  }

  if (formType === "login") {
    return <div>Login</div>;
  }
};

export default AuthForm;
